import React from "react";

const Search = ({ handleSubmit }) => {
  return (
    <div className="container py-8 text-center ms-16">
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          value={value}
          // onInput={handleChange}
        />
        <br />
        <br />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default Search;
